import "./ProductCard.css"

export function ProductCard(props) {

    const {title="Тут должно быть название...", 
            img="https://www.ferra.ru/thumb/1200x0/filters:quality(75):no_upscale()/imgs/2022/01/20/19/5183207/292e5d200b746c2b842c8437909ca6a36aa7799e.jpg", 
            id} = props;

    return (
        <div className="product-card" data-id={id}>
            <img src={img} className="product-card__img" alt="изображение" />
            <h3 className="product-card__title">{title}</h3>
            <span className="product-card__like-counter">Лайки: </span>
            <button className="product-card__like-btn product-card__btn">Лайкнуть!</button>
        </div>
    )
}
